#include <stdlib.h>
#include <assert.h>
#include <math.h>

#include "integrands.h"

const size_t nparticles = 7;

static double potential(const double q[nparticles]);

double end_to_end_integrand(double angles[], size_t dim, void* params) {
        size_t k;

        double x = 0.0, y = 0.0;
        for (k = 0; k < dim; k++) {
                double s, c;
                sincos(angles[k], &s, &c);
                x += c;
                y += s;
        }

        const double end_to_end_distance = hypot(x, y);

        return end_to_end_distance
                * partition_function_integrand(angles, dim, params);
}

